import React from 'react';
import BulletDescription from './BulletDescription';
import experienceData from '../Data/ExperienceData';

const ExperienceIndi = () => {
  return (
    <div className="experience-indi">
      <div className="left">
        <img
          className="logo"
          src={this.props.logo}
          alt={this.props.company + ' logo'}
          height="200"
          width="200"
        />
        <div className="text">
          <h2 className="company">{this.props.company}</h2>
          <h5 className="location"> {this.props.location}</h5>
          <h5 className="date"> {this.props.date}</h5>
        </div>
      </div>
      <div className="right">
        <h3 className="title">{this.props.role}</h3>
        {console.log(this.props)}
        <BulletDescription descriptions={this.props.descriptions} />
      </div>
      <hr />
    </div>
  );
};

export default ExperienceIndi;
